import React, { Component } from 'react';

class HelpScreen extends Component {
  render() {
    return (
      <div>
        <h1>Help</h1>
        <p>Welcome to the help screen!</p>
        <p>Here are some tips to help you get started:</p>
        <ul>
          <li>Tip 1</li>
          <li>Tip 2</li>
          <li>Tip 3</li>
        </ul>
      </div>
    );
  }
}

export default HelpScreen;
